import React from "react";
import PropTypes from "prop-types";

const AllGradeList = ({ title, schoolYear }) => {
  return (
    <div>
      <div>{title}</div>
      <div>
        1 klas
        <table>
          <tbody>
            {schoolYear.map(grade => (
              <React.Fragment>
                {grade.grade === 1 ? (
                  <tr className="search_row">
                    <td>
                      {grade.grade}
                      {grade.subGrade}
                    </td>
                    <td>{grade.teacher}</td>
                    <td>
                      <button className="stu_add">redakciika :)</button>
                    </td>
                  </tr>
                ) : (
                  ""
                )}
              </React.Fragment>
            ))}
          </tbody>
        </table>
      </div>

      <div>
        2 klas
        <table>
          <tbody>
            {schoolYear.map(grade => (
              <React.Fragment>
                {grade.grade === 2 ? (
                  <tr className="search_row">
                    <td>
                      {grade.grade}
                      {grade.subGrade}
                    </td>
                    <td>{grade.teacher}</td>
                    <td>
                      <button className="stu_add">redakciika :)</button>
                    </td>
                  </tr>
                ) : (
                  ""
                )}
              </React.Fragment>
            ))}
          </tbody>
        </table>
      </div>

      <div>
        3 klas
        <table>
          <tbody>
            {schoolYear.map(grade => (
              <React.Fragment>
                {grade.grade === 3 ? (
                  <tr className="search_row">
                    <td>
                      {grade.grade}
                      {grade.subGrade}
                    </td>
                    <td>{grade.teacher}</td>
                    <td>
                      <button className="stu_add">redakciika :)</button>
                    </td>
                  </tr>
                ) : (
                  ""
                )}
              </React.Fragment>
            ))}
          </tbody>
        </table>
      </div>

      <div>
        4 klas
        <table>
          <tbody>
            {schoolYear.map(grade => (
              <React.Fragment>
                {grade.grade === 4 ? (
                  <tr className="search_row">
                    <td>
                      {grade.grade}
                      {grade.subGrade}
                    </td>
                    <td>{grade.teacher}</td>
                    <td>
                      <button className="stu_add">redakciika :)</button>
                    </td>
                  </tr>
                ) : (
                  ""
                )}
              </React.Fragment>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

AllGradeList.propTypes = {};

export default AllGradeList;
